„Projekt Tymczasem” to inicjatywa, której finał będzie miał miejsce już 6 października na deskach Teatru im. Słowackiego w Krakowie, gdzie spotka się czołówka rapowej sceny. W ramach projektu weterani rapu połączyli siły z reprezentantami nowej szkoły, reinterpretując wzajemnie jedne z najważniejszych numerów w swoim dorobku. Zobaczcie pierwszy efekt tej współpracy – klip do „Chcemy Być Wyżej” Sokoła, utworu oryginalnie nagranego przez Sitka.
 
Więcej info o wydarzeniu: http://www.projekttymczasem.pl

