EVIL_THINGS to długo wyczekiwany album długogrający (LP) Guziora, jednego z pierwszych reprezentantów QueQuality. Płyta zabiera słuchacza w podróż po nieodkrytych wcześniej meandrach umysłu artysty. Kąśliwe wersy, zróżnicowane produkcje i wyraźnie nakreślony charakter gospodarza stanowią świetną kontynuacje Eviltwin, pierwszego legalnego wydawnictwa rapera które pokryło się złotym wyróżnieniem. 

